import React from "react";
import { Link } from "react-router-dom";
import "./pokeList.css";

function PokeList({ pokemon, nextPage, prevPage, goNextPage, goPrevPage }) {
    function Page({ goNextPage, goPrevPage }) {
        return (
            <div className="buttons">
                {goPrevPage && <button className="button-left" onClick={goPrevPage}>Previous</button>}
                {goNextPage && <button className="button-right" onClick={goNextPage}>Next</button>}
            </div>
        )
    }

    return (
        <div className="container">
            {pokemon.map(p => (
                    <div className="poke-div" key={p.name}>
                        <Link to={`/pokemon/${p.name.toLowerCase()}`}>{p.name}</Link>
                        <img src={p.sprites.front_default} alt=""/>
                    </div>

            ))}
            <Page 
        goNextPage={nextPage ? goNextPage : null}
        goPrevPage={prevPage ? goPrevPage : null} />


        </div>
    )

}

export default PokeList;
